import React, { Suspense } from "react";
import "./App.css";
import { IntlProvider } from "react-intl";
import { BrowserRouter as Router, Switch, Redirect } from "react-router-dom";
import { ProtectedRoute } from "./components/Auth/PrivateRoute.js";
import InversedWithAuth from "./components/Auth/InversedWithAuth";
import { adminRoot } from "./constants";
import AppLocale from "./lang";

const DashboardPage = React.lazy(() => import("./pages/DashboardPage.js"));
const ViewUser = React.lazy(() => import("./views/User.js"));
function App() {
	const locale = "en";
	const currentAppLocale = AppLocale[locale];
	return (
		<IntlProvider
			locale={currentAppLocale.locale}
			messages={currentAppLocale.messages}
		>
			<Suspense fallback={<div className="loading" />}>
				<Router>
					<Switch>
						<InversedWithAuth
							path="/user"
							render={(props) => <ViewUser {...props} />}
						/>
						<ProtectedRoute path={adminRoot} component={DashboardPage} />
						<Redirect to="/error" />
					</Switch>
				</Router>
			</Suspense>
		</IntlProvider>
	);
}

export default App;
